const Password = () => {
  return (
    <section
      className="coh-container section coh-style-section"
      data-gs-background-color="light-grey"
    >
      <div>
        <div>
          <div className="coh-container text-main-container"></div>
          <form>
            <input type="text" />
          </form>
        </div>
      </div>
    </section>
  );
};

export default Password;
